Thankyou for having me as your host, Miss Grand Falcon 2024. It has been an incredible journey to witness this pageant from every perspective it has to offer. From the honour of being crowned to crowning the next queen, to later serving as a judge and now representing the pageant as its host, I’ve come a full circle and it has been a very wholesome experience for me. Each chapter with my different roles has only deepened my appreciation for this pageant.

